import React from "react";
// import {Link} from "react-router-dom";
import "./header.css";
import {Logo,Avatar} from "../../assests/images"
import {BiSearch} from "../../assests/icons";

export const Header = () => {
  return (
    <div className="header flex-row justify-between align-center px-2">
      <div className="flex-row justify-center align-center">
        <img className="logo-image" src={Logo} alt="logo" />
        <span className="logo-text font-se">
          Quiz<span className="text-orange">Buzz</span>
        </span>
      </div>
      <div className="search-bar-container">
        <button>
          <BiSearch/>
        </button>
        <input type="search" placeholder="Search" className="search-bar" />
      </div>

      <div className="flex-row justify-center align-center">
        <div className="mr-2">
          {/* <Link to="/login">Login</Link> */}
        </div>
        <div className="component-image-rounded user-sm-image">
          <img src={Avatar} alt="avatar" />
        </div>
      </div>
    </div>
  );
};
